import cartActionTypes from "./cart.types";

export const toogleCartHidden = () => ({
  type: cartActionTypes.TOOGLE_CART_HIDDEN
});

export const addCartItem = () => ({
  type: cartActionTypes.ADD_CART_ITEM
});
